{

   var id=2241, name="Satheesh", phone=9866258049, city="hyderabad"



    return(<>

         
    
       <div className="border p-5">
           <h1 style={styles}>PARENT-COMPONENT</h1>
  
         <h5> {id}<br/>
          {name}<br/>
          {phone}<br/>
          {city}</h5>

           <br/><br/>
          
           <Child id={id} name={name} phone={phone} city={city}/>


       </div>

      

    </>)
}

export default Parent;
